import React from "react";
import { Container,Row,Col,Button } from "reactstrap";
import { Link } from "react-router-dom";
import '../styles/thank-you.css'

const ThankYou = () => {
  return (
    <section>
      <Container>
        <Row>
          <Col lg='12'>
            .thank__you
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default ThankYou;
